import React from "react"
import UltimateTheme from "./UltimateTheme"

export default function Button(props){
    return (
        <UltimateContext.Consumer>
            {({text, toggle}) => {
                console.log(text, toggle)
                return (
                    <button onClick={toggle}> {text} </button>
                )
            }}
        </UltimateContext.Consumer>
    )
}
